import React from 'react';
import axios from 'axios';

// const API_KEY = 'c606d611';
// const API_URL = 'http://www.omdbapi.com/?apikey=c606d611';

// http://www.omdbapi.com/?i=tt3896198&apikey=c606d611

class Movies extends React.Component {
    state = {
        movie: [],

    }

    componentDidMount() {
        axios
        .get('http://www.omdbapi.com/?t=annie&apikey=c606d611')
        .then(response => {
            console.log(response.data)
            this.setState({
                movie: response.data
            })
        })
        .catch(error => {
            console.log(error)
        })
    }


    render() {
        return (
            <>
            <h1>Movies Page</h1>
            <h2>{this.state.movie.Title}</h2>
            <p>{this.state.movie.Year}</p>
            <p>{this.state.movie.title}</p>

            </>

        )
    }
}

export default Movies;
